export default function TodoList() {

    let todoList = [
        {id: 1, text:'Morning routine'},
        {id: 2, text:'Coding' }, 'Workout', 'Time w fav people']
 
    return (
        <ul>
            {todoList.map((todo, i) => <li type='none' key = {i}>Task: {todo}</li>)}
        </ul>
    );
}
